import React, { useEffect, useState } from "react";
import { useLocation } from "react-router-dom";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import { color } from "@mui/material/node_modules/@mui/system";

const UnsecurePassList = (props) => {
  const location = useLocation();
  const [pass, setPass] = useState([]);

  useEffect(() => {
    setPass(location.state.passwords);
    alert(location.state.passwords);
  }, []);

  return (
    <div>
      <TableContainer>
        <Table sx={{ minWidth: 650 }} aria-label="simple table">
          <TableHead
            style={{
              backgroundColor: "red",
            }}
          >
            <TableRow>
              <TableCell style={{ fontWeight: "bold", fontSize: "50" }}>
                Index
              </TableCell>
              <TableCell>Passwords</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {pass.map((item, index) => (
              <TableRow
                key={index}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell component="th" scope="row">
                  {index}
                </TableCell>
                <TableCell component="th" scope="row">
                  {item}
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
};

export default UnsecurePassList;
